-- check_email_pattern() function

create or replace function check_email_pattern(Email IN varchar2)
RETURN number
is



begin

if REGEXP_LIKE(Email, '^[A-Za-z]+[A-Za-z0-9.]+@[A-Za-z0-9.-]+\.[A-Za-z]{2,4}$')then
return 1;
else return 0;

end if;

end check_email_pattern;
/

-- is_number() function

create or replace FUNCTION is_number (p_string IN VARCHAR2)
RETURN INT
IS
v_num NUMBER;
BEGIN
v_num := TO_NUMBER(p_string);
RETURN 1;
EXCEPTION
WHEN VALUE_ERROR THEN
RETURN 0;
END is_number;
/

--DROP ENTITY PROCEDURE

create or replace PROCEDURE DROP_ENTITY(ENTNAME varchar2,ENTTYPE varchar2) IS 
nCount NUMBER;
BEGIN
if ENTTYPE = 'TABLE' THEN
SELECT count(*) into nCount FROM user_tables where table_name = upper(ENTNAME);
IF (nCount > 0) THEN 
    EXECUTE IMMEDIATE 'drop table ' || ENTNAME || ' cascade constraints';
END IF;
END IF;

if ENTTYPE = 'PROCEDURE' THEN
    select count(*) into nCount from user_objects where object_type = 'PROCEDURE' and object_name = upper(ENTNAME);
      if nCount > 0 then          
        execute immediate 'DROP PROCEDURE ' || ENTNAME;        
      end if; 
  end if;
  
 if ENTTYPE = 'TRIGGER' then
    select count(*) into nCount from user_triggers where trigger_name = upper(ENTNAME);
      if nCount > 0 then          
        execute immediate 'DROP TRIGGER ' || ENTNAME;
      end if; 
  end if;
  
  if ENTTYPE = 'SEQUENCE' then
    select count(*) into nCount from user_sequences where sequence_name = upper(ENTNAME);
      if nCount > 0 then          
        execute immediate 'DROP SEQUENCE ' || ENTNAME;        
      end if; 
  end if;
  if ENTTYPE = 'USER' then
    select count(*) into nCount from all_users where username = upper(ENTNAME);
      if nCount > 0 then          
        execute immediate 'DROP USER ' || ENTNAME;        
      end if; 
  end if;
 if ENTTYPE = 'PROFILE' then
    select count(*) into nCount from all_users where username = upper(ENTNAME);
      if nCount > 0 then          
        execute immediate 'DROP PROFILE ' || ENTNAME;        
      end if; 
  end if;
END;
/

